import { apiBase } from "./index";

export const bookingAPI = apiBase.createInstance({
    endpoint: "/booking",
    method: "post",
    reducer: "bookingReducer",
    key: "id",
    reduxKey: "AddBookingData",
    action: "ADD_BOOKING_DATA",
    onSuccess: (data) => data,
    onError: (data) => data,
});
